import React, { useState } from 'react';
import { Document, Page, View, Text, Link, pdf, StyleSheet } from '@react-pdf/renderer';
import { Accordion, AccordionSummary, AccordionDetails, Typography } from '@mui/material';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';

// Define a custom stylesheet
const styles = StyleSheet.create({
  page: {
    flexDirection: 'column',
    padding: 20,
  },
  section: {
    margin: 10,
  },
  subsection: {
    marginLeft: 10,
  },
  link: {
    color: 'blue',
  },
});

const PathStepBox = ({ step }) => {
  const [currentStep, setCurrentStep] = useState(0);

  const nextStep = () => {
    if (currentStep < (step.details || []).length - 1) {
      setCurrentStep(currentStep + 1);
    }
  };

  const prevStep = () => {
    if (currentStep > 0) {
      setCurrentStep(currentStep - 1);
    }
  };

  const generatePDF = async () => {
    // Create a blob of the PDF and trigger a download
    const blob = await pdf(
      <Document>
        <Page size="A4" style={styles.page}>
          <View style={styles.section}>
            <Text>{step.content}</Text>
          </View>
          {step.details ||
            step.steps.map((item, index) =>
              item.details.map((deets, deetsIndex) => (
                <View key={deetsIndex} style={styles.subsection}>
                  <Text>
                    <Text style={{ fontWeight: 'bold' }}>Name:</Text> {deets.title}
                  </Text>
                  <Text>
                    <Text style={{ fontWeight: 'bold' }}>Description:</Text> {deets.content}
                  </Text>
                  <Accordion>
                    <AccordionSummary expandIcon={<ExpandMoreIcon />}>
                      <Typography variant="h6">Resources</Typography>
                    </AccordionSummary>
                    <AccordionDetails>
                      <View>
                        {deets.skills &&
                          deets.skills.map((skill, skillIndex) => (
                            <Text key={skillIndex}>
                              <Text style={{ fontWeight: 'bold' }}>{skill.title}:</Text>
                              {skill.resource && (
                                <Link src={skill.resource} style={styles.link}>
                                  {"Getting started with: " + skill.title}
                                </Link>
                              )}
                            </Text>
                          ))}
                      </View>
                    </AccordionDetails>
                  </Accordion>
                </View>
              ))
            )}
        </Page>
      </Document>
    ).toBlob();

    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = 'path.pdf';
    a.click();
  };

  return (
    <div>
      <h4>{step.content}</h4>
      <button onClick={generatePDF}>Download PDF</button>
      {step.details ||
        step.steps.map((item, index) =>
          item.details.map((deets, deetsIndex) => (
            <div key={deetsIndex}>
              <p>
                <strong>Name:</strong> {deets.title}
              </p>
              <p>
                <strong>Description:</strong> {deets.content}
              </p>
              <Accordion>
                <AccordionSummary expandIcon={<ExpandMoreIcon />}>
                  <Typography variant="h6">Resources</Typography>
                </AccordionSummary>
                <AccordionDetails>
                  <ul className="skills-list">
                    {deets.skills &&
                      deets.skills.map((skill, skillIndex) => (
                        <li key={skillIndex}>
                          <strong>{skill.title}</strong>: {skill.resource && (
                            <a href={skill.resource} target="_blank" rel="noopener noreferrer">
                              {"Getting started with: " + skill.title}
                            </a>
                          )}
                        </li>
                      ))}
                  </ul>
                </AccordionDetails>
              </Accordion>
            </div>
          ))
        )}
    </div>
  );
};

export default PathStepBox;
